import React from 'react';
import Squares from './Squares';

export default function Rows({ fillSquare, board, game, winners, active }) {
  //   winners = [a,b,c]
  return (
    <>
      <div className='first-row'>
        {game.finished ? (
          <Squares
            sPos='0'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        ) : (
          <Squares
            sPos='0'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        )}
      </div>
      <div className='second-row'>
        {game.finished ? (
          <Squares
            sPos='3'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        ) : (
          <Squares
            sPos='3'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        )}
      </div>
      <div className='third-row'>
        {game.finished ? (
          <Squares
            sPos='6'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        ) : (
          <Squares
            sPos='6'
            fillSquare={fillSquare}
            board={board}
            game={game}
            active={active}
          />
        )}
      </div>
    </>
  );
}
